import logging
from datetime import datetime
from typing import List, Dict

# Initialize the logging system
logging.basicConfig(level=logging.INFO, format='%(asctime)s - %(levelname)s - %(message)s')

class Submission:
    def __init__(self, id: int, status: str, publish_status: bool, creation_date: datetime):
        self.id = id
        self.status = status
        self.publish_status = publish_status
        self.creation_date = creation_date

class FABS:
    def __init__(self):
        self.submissions = []

    def add_submission(self, submission: Submission):
        self.submissions.append(submission)
        logging.info(f"Added submission {submission.id} to FABS system")

    def update_publish_status(self, submission_id: int, publish_status: bool):
        for submission in self.submissions:
            if submission.id == submission_id:
                submission.publish_status = publish_status
                logging.info(f"Updated publish status of submission {submission_id} in FABS system")
                return
        logging.warning(f"Submission {submission_id} not found in FABS system")

    def process_deletions(self, date: datetime):
        self.submissions = [submission for submission in self.submissions if submission.creation_date != date]
        logging.info(f"Processed deletions for date {date} in FABS system")

